import React from './node_modules/react'
import { Dropdown, Image } from './node_modules/semantic-ui-react'
import logo from '../../img/Logo-Fablab.png';

const trigger = (
  <span>
    <Image size="mini" avatar src={logo} /> {"Administrador"}
  </span>
)

const options = [
  { key: 'sign-out', text: 'Cerrar Sesión', icon: 'sign out' },
]

const DropdownImageTriggerExample = () => (
  <Dropdown
    trigger={trigger}
    options={options}
    pointing='top left'
    icon={null}
  />
)

export default DropdownImageTriggerExample
